import setup from './services/setup';
import shared from './shared/shared';
import { pollerLite } from './helpers/utils';
import productsWrapper from './components/productsWrapper';
import freeShippingBar from './components/freeShippingBar';

const { ID, VARIATION } = shared;

const imageConfig = {
  'ui-id-2':
    'data:image/png;base64,',
  'ui-id-3':
    'data:image/png;base64,',
  'ui-id-4':
    'data:image/png;base64,',
  'ui-id-5':
    'data:image/png;base64,',
  'ui-id-6':
    'data:image/png;base64,',
  'ui-id-7':
    'data:image/png;base64,'
};

const getProductList = (listItems) => {
  //const listItems = [...document.querySelectorAll('#system_product-menu li')].slice(1);

  return listItems.map((li) => {
    const { id } = li;
    const div = li.querySelector('div');
    const text = div?.childNodes[0]?.textContent.trim() || '';

    const image = imageConfig[id];

    return {
      id,
      text,
      image
    };
  });
};

const init = () => {
  const targetPoint = document.querySelector('.accessories-banner');
  const accessoriesBtn = targetPoint.querySelector('#system_product-button');
  const freeShippingBarElem = targetPoint.querySelector('.accessories-free-shipping-banner');
  if (accessoriesBtn) {
    accessoriesBtn.click();
  }
  const listItems = [...document.querySelectorAll('#system_product-menu li')].slice(1);
  pollerLite([() => listItems.length > 0], () => {
    const products = getProductList(listItems);

    if (products.length > 0 && !document.querySelector(`.${ID}__productsWrapper`)) {
      targetPoint.insertAdjacentHTML('beforebegin', productsWrapper(ID, products));
    }
    accessoriesBtn.click();

    if (freeShippingBarElem && !document.querySelector(`.${ID}__banner`)) {
      targetPoint.insertAdjacentHTML('beforebegin', freeShippingBar(ID));
    }

    const firstItem = document.querySelector(`.${ID}__item`);
    if (firstItem) {
      firstItem.click();
    }

    const carryBagElem = document.querySelectorAll('.post--pdp__package.other-accessories');

    if (carryBagElem.length > 0) {
      carryBagElem.forEach((item) => {
        const accessoryBlock = document.querySelector(
          '.accessory-blocks-container > .accessory-blocks'
        );
        accessoryBlock.insertAdjacentElement('beforeend', item);
      });
    }

    if (VARIATION !== '2') {
      return;
    }

    const prodCards = document.querySelectorAll('.post--pdp__package');
    prodCards.forEach((card) => {
      const titleContainer = card.querySelector('.post--pdp__package-title');
      const detailContainer = card.querySelector('.post--pdp__package-detail');
      const priceContainer = card.querySelector('.post--pdp__package-price');
      if (!titleContainer || !detailContainer || !priceContainer) return;

      if (card.classList.contains('post--pdp__package--variation-2')) return;
      const titleElemInner = titleContainer.innerHTML;
      detailContainer.insertAdjacentHTML('afterbegin', titleElemInner);
      detailContainer.insertAdjacentElement('afterend', priceContainer);
      card.classList.add('post--pdp__package--variation-2');
    });
  });
};

export default () => {
  setup();

  document.body.addEventListener('click', (e) => {
    const { target } = e;
    console.log(target, 'target');
    if (target.closest(`.${ID}__item:not(.view-all)`)) {
      const clickedItem = target.closest(`.${ID}__item`);
      const { id } = clickedItem.dataset;
      const controlItem = document.querySelector(`li#${id}`);
      if (controlItem) controlItem.click();
    } else if (target.closest(`.${ID}__item.view-all`)) {
      const clickedItem = target.closest(`.${ID}__item`);
      const { id } = clickedItem.dataset;
      const controlItem = document.querySelector(`li#${id}`);
      if (controlItem) controlItem.click();
    }
  });

  init();
};
